import styled from 'styled-components';
import theme from '../../style/theme';

export const Main = styled.main`
    width:100%;
    background-color:#eceae9;

    display:flex;
    justify-content:center;
    align-items:center;
`;

export const Content = styled.div`
    width:60%;
    border:1px solid black;

    @media ${theme.tabletL} {
        width:80%;
    }

    @media ${theme.mobileL} {
        width:90%;
    }
`;
